"use strict";

const path = require("path");
const { Image } = require("image-js");
const { extractHOG } = require("hog-features");

const hoggy = require("../");

describe("hog test",  () => {
  let descriptorSize, sizeExpected, options, beachBall;

  beforeAll(async () => {
    const sizeImage = 110; // image test1/png is square sizeImage*sizeImage
    options = {
      cellSize: 4,
      bins: 6,
      blockSize: 2,
      blockStride: 1
    };

    sizeExpected =
      (Math.floor(
        (parseFloat(sizeImage) / options.cellSize - options.blockSize) /
          (options.blockSize - options.blockStride)
      ) +
        1) **
        2 *
      options.bins *
      options.cellSize;
      beachBall = await Image.load("data:image/png;base64,");
  });

  it("extractHOG result should match hoggy result", () => {
    expect(hoggy(beachBall, options)).toEqual(extractHOG(beachBall, options));
  });

  it("extractHOG result should be correct size", () => {
    expect(extractHOG(beachBall, options).length).toEqual(sizeExpected);
  });

  it("hoggy result should be correct size", () => {
    expect(hoggy(beachBall, options, {}).length).toEqual(sizeExpected);
  });
});
